webpackJsonp([0xd9d78474bdd9],{1114:function(A,e){A.exports={data:{markdownRemark:{html:'<p>Today’s interview is with Rachel Barnum, a really awesome instructional designer who I’ve followed on Twitter for some time now. Interested in ID roles that focus on face-to-face workshops? This one’s for you! Rachel shares how she transitioned from more development-focused roles to a role that is currently more focused on face-to-face experiences. She shares how she wrangles projects with 5 SMEs (5 SMEs!) as opposed to 1 or 2 and what a portfolio for someone in this type of ID role might look like.</p>\n<iframe src="https://simplecast.com/e/38101?style=medium-light" width="100%" height="94px" frameborder="0" scrolling="no" seamless=""></iframe>',frontmatter:{date:"June 16, 2016",path:"/blog/dear-id-show-interview-with-rachel-barnum",title:"Dear ID Show! Interview with Rachel Barnum",tags:["dear id","face-to-face","interview","podcast"],categories:["Dear ID Show","elearning"],featured:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:3,src:"/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c6512.jpg",srcSet:"/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c7d05.jpg 203w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-784f5.jpg 405w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-c6512.jpg 810w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-adada.jpg 1215w,\n/static/twitter-8f833ed6b7e5464c0e3be8d40e769b35-1c372.jpg 1500w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
